import React from "react"

export default function RecipeCard (props) {
    return(
        <li className="recipe-card">
            <h2>{props.recipe.label}</h2>
            <p>Calories: {props.recipe.calories.ro}</p>
            <img src={props.recipe.image} alt=""/>
        </li>
    )
}
